(1, 1, 'info@arsip.semarangkota.go.id', 'Sistem Informasi Kearsipan Dinamis', 'SIKD', 'Pemerintah Kota Semarang', 'Kota Semarang', 2018, 'Memudahkan dalam manajemen pengelolaan arsip secara otomasi sejak diciptakan sampai dengan penyusutan dan meminimalkan penggunaan kertas (paperless office), mendukung program Pemerintah dalam mewujudkan Keterbukaan Informasi Publik, memudahkan penemuan arsip apabila sewaktu-waktu dibutuhkan, mengoptimalkan kemajuan Teknologi Informasi dalam memberikan layanan informasi', '<h2 class=\"section-heading\">Dasar Hukum</h2>\n<ol>\n<li>Undang-Undang Nomor 43 Tahun 2009 tentang Kearsipan</li>\n<li>Peraturan Pemerintah Nomor 28 Tahun 2012 tentang Petunjuk Pelaksanaan Undang-Undang Nomor 43 Tahun 2009 tentang Kearsipan</li>\n<li>Perda no. 1 Tahun 2015 tentang Penyelenggaraan Kearsipan Jawa Tengah</li>\n<li>Keputusan Gubernur Jawa Tengah Nomor 109 Tahun 2003 tentang Pedoman Pengurusan Surat di Lingkungan Pemerintah Provinsi Jawa Tengah</li>\n<li>Keputusan Gubernur Jawa Tengah Nomor 108 Tahun 2003 tentang Pedoman Penataan Berkas di Lingkungan Pemerintah Provinsi Jawa Tengah</li>\n</ol>');
